                                "text": "东南亚某国、唐人街、出现新型软性毒品，私家侦探隋枫奉命（na qian）调查。<br/>一桩看似普通的调查案，却隐藏着不为人知的隐秘，一个接一个的血腥命案将真相重重掩盖。<br/>十年前的悲剧早已被人遗忘，伤痛或许只藏在受害者的内心深处。当世间所有的常理被颠覆、正义被撕碎、善与恶的交界逐渐变得模糊……<br/>你，会坚持自己的选择吗？<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>游戏特点：<br/>丰富的剧情和可互动的角色，让您更好地沉浸在故事情节中<br/>与剧情相辅相成的立绘插画与演出，为您带来更好的视听体验<br/>结合剧情的多元化解密元素，增加游玩乐趣<br/>隐藏在各个角落的收集要素，可以解锁成就和剧情彩蛋<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>游戏额外特点：<br/>不氪金！不看广告！后期拿到版号将实行买断制发售，无任何形式内购。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>欢迎您通过【风筝】游戏群：608222616 给我们提供宝贵建议和意见！"
