                            "description": {
                                "text": "嗨，还记得大胡子巴巴六吗？融合竞技与冒险的魔性乱斗手游《野蛮人大作战2》来啦！<br/>逗趣搞怪的野蛮人英雄，魔性奇葩的道具宠物；<br/>经典3v3v3乱斗加上多种全新创意模式，欢乐竞技全程高能根本停不下来！<br/>化身野蛮人酋长狩猎巨兽击退强敌守护部落，多种副本全新冒险等你解锁！<br/>准备好了吗，与巴巴六一起在充满欢乐的野蛮世界开启乱斗之旅吧！<br/>游戏特色：<br/>【3v3v3即时乱斗 魔性战斗停不下来】<br/>游戏继承《野蛮人大作战》的3v3v3经典玩法和搞怪逗趣的角色形象。单局6分钟，即开即打。多阵营乱斗，酣畅淋漓。用地图里的冰蘑菇、火蘑菇投掷敌人，还能产生奇妙效果。吃吃吃，砍砍砍，欢乐无穷超乎想象！<br/>【多种魔性竞技玩法 把敌人扛起来扔出地图！】<br/>玩腻了经典模式？PVP竞技还有无限乐趣！闻所未闻的船上乱斗，可把对手勾到自己家里围殴，也可穿越到后方大杀四方！空中岛屿欢乐道具战，直接把盯上的对手扔下岛！熔岩大乱斗，别光顾着偷家了，小心被烧焦！游戏内还有更多创意玩法，你一定不会感到无聊！<br/>【打倒大蘑菇化身魔王 可别被吃掉！】<br/>边吃蘑菇边成长，你可以发育打架，嗨翻全场，也可以偷菇阴人，秀出操作！凶恶的大蘑菇会在战场随机出现，打倒它，你就能变身大魔王成为全场焦点，但是要当心，可别被大蘑菇一口吞掉！<br/>【打造你的专属流派 跳劈、护盾、地刺技能任你选择】<br/>单局游戏技能随机，任你挑选。暴力输出释放龙卷风席卷全场、强化护盾疯狂弹反成为战场毒瘤、升级地刺技能所过之处寸草不生。没有最强的套路，只有最邪的打法！打造专属流派，秀出你的骚操作！<br/>【武器、坐骑、宠物搭配 大鸡腿打人也很疼！】<br/>背起肉串、扛起鸡腿，准备出发！——别误会，我们可不是去野餐，而是去打架的！仙人球、咬人花、大鲨鱼、可以把野蛮人变成小乌龟的蘑菇法杖，野蛮人的武器超乎你的想象！长着猫耳的傻狗、长着象鼻的麋鹿，各种稀奇古怪的萌宠尽在蛮蛮大陆！<br/>【开团狩猎巨兽 击败巨大蘑菇、章鱼】<br/>巨型蘑菇怪来袭，海边的大章鱼兴风作浪……野蛮人勇士们，拿起武器，到狩猎巨兽的时候了！<br/>【成为受人敬仰的酋长】<br/>酋长，萨萨塔想在部落建博物馆！酋长，巨人又来抢东西啦！酋长，同伴被独眼怪物抓走了！解决村民的困难，击败入侵的强敌，成为一名合格的酋长可不轻松!<br/>【打造你的最强部落】<br/>来享受欢乐的部落生活吧！部落是属于你的私人空间，在这里打造武器，孵化宠物，强化自身；或者收收金币、种种蘑菇，与长老唠唠嗑，休闲生活。更多惊喜玩法等你发现。"
                            },
