                            "description": {
                                "text": "《伊瑟·重启日》是由心动自主研发的一款近未来都市鬼神职人题材的回合制RPG游戏。游戏的舞台是名为「伊瑟」的虚拟都市；你将化身「超链者」，与鬼神职人「异格者」并肩战斗，对抗未知病毒的入侵，探索危机背后的阴谋，体验多种势力之间的明争暗斗。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【在虚实之间遇见未来】<br/>现实中，一切有形的事物被一场永不停息的暴雪湮没。为了拯救仅存的意识，人类创造了虚拟世界「伊瑟」来置放思维、情感，并开启新的生活。<br/>摩天大楼、金融商业区、时尚街头……流动的霓虹和数据光芒在都市中奔流不息。用丰富多彩的虚拟都市风光打造出游戏内的冒险场景，与穿梭在其中工作生活的鬼神职人，共同缔造出奇幻又真实的新都市风貌。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【循百鬼职人，绘都市万象】<br/>传统鬼神化身未来职人，「异格者 Animus」与你并肩而战。<br/>打破传统题材对角色塑造的局限性，古老的鬼神传说与先锋的都市文化将会在游戏里彼此相互碰撞。收集形态各异的卡牌角色并与他们产生链接和共鸣，发挥出他们多样的超自然能力和战斗技巧，在虚拟都市中与鬼神职人一同探索真相。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【聚光灯下，暗流涌动】<br/>作为故事主角，你身负「超链者」的特殊能力，往来于两个世界完成雇佣者的委托。未知病毒使得伊瑟世界原本平静的假象开始崩溃，霓虹都市之下深藏的秘密也将被揭开。<br/>人类崇拜的，恐惧的，抛弃的……记忆与情感所构筑的数据海市蜃楼，再次向你敞开。"
                            },
