                            "whatsnew": {
                                "text": "<div>《后续等待更新的系统》<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>古代战争不删档至今好久好久啦，第一个服务器天启位面是2018年8月21日开启的，我们保持每周更新一次的节奏，一直持续到了今天。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>几年时间，周更，做着做着，游戏包体变成好几百M，解压缩后整整1G多。游戏越来越庞大，可做的新系统也越来越少了。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>过多的系统堆砌会让游戏变得非常臃肿，导致大家上线后要干的事情太多，时间会过长。无论多好玩的玩法，只要重复一个月后，就会变得非常枯燥。最典型的应该是迷宫玩法了，ROGUELIKE加随机事件，一开始很好玩，玩久了就会腻，最后我们只能加入扫荡等各种一键式操作，以此解约大家的时间。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>所以比较合理的做法是做出新玩法，做成活动形式（蛮多二次元游戏就是这样做的）这样每次活动有新鲜的东西玩，然后又能拿一波资源，这几天活动结束后，可以暂时休息下，等待下次活动，这样较为舒适的节奏。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>在这样的思路引导下，我们做了限时BOSS活动，答题活动，阵营战活动，双免BOSS活动，以及一月一次轮回的位面战等。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>目前看来这些活动反馈还不错，因为是轮回不定期开放，所以不太容易腻。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>所以未来古代战争的更新方式，一方面是继续增加英雄配合，让角色搭配的玩法更加多样化，更好玩些。比如亡灵队的逐渐成型，就是一个不错的案例。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>一方面是增加些新鲜好玩的玩法，比如大头我正在构思中的大型活动，让大家可以在活动期间选择自己喜欢的角色，然后在活动里直接获得满级，满神器，满觉醒，使角色是100%的强度，然后再去PVE或者是PVP这样的玩法。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>这样可以让大家使用一些平常想试试，但是却怕浪费资源而不敢使用的角色，玩一些新鲜的不一样的英雄搭配出来，用你的策略和操作去获取更多的资源，会比较好玩。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>当然，大头我还想做更多其他的玩法，我一直想做的剧情副本活动，比如这期剧情副本是正义，那就在副本里讲述正义堕落的整个过程，他是默默爱着星辰又默默退出，在听到星辰死亡噩耗后的绝望，战场叛变斩杀守望致使人族联军大败，最终率领暗黑骑士军团攻破天启城这样的整条剧情线。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>不过想法是很美好的，碍于成本问题一直做不了哈哈。剧情副本需要的美术资源实在太多了，比如过场CG，人物配音，比如天启城的地图场景，等等等等，一直有点无从下手。希望未来能找到一种比较节省美术资源，但又能很好地展示剧情和氛围的做法，把这个剧情副本做出来，让大家可以看到英雄们真实的恩怨情仇，人生历程。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>当然，大头我也很欢迎大家多提些玩法建议，反馈给我们。要知道，血战系统这个玩法，当初就是18年有个玩家说了这个创意，然后我觉得很NICE，立刻按照古代战争的调性，魔改成了现在的血战。两年来血战是古代战争最核心的玩法之一，但这个系统的起因，就是来自于玩家建议。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>所以，期待你们更多更优秀的反馈，如果很OK的话，大头我会参考，并且做进游戏里的。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>游戏里点击一键加群，就可以进入我们的官方Q群，联系群主，就可以找到我们。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>感谢你对古代战争的喜爱，古代战争会运营很多年，大头我会一直都在，也感恩你的一路陪伴，无论何时何地，欢迎你玩，也欢迎你回来看看，我们会一直在这里等你。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>猫步大头——敬上。</div>"
                            },
                            "description": {
                                "text": "人族濒临灭绝，放置拯救世界！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>[游戏特色]<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>★ 有血有肉的角色，等待探索的世界<br/>★ 套装收集癖福音，策略搭配战不停<br/>★ 三系天赋三系分支，主动防御被动搭配<br/>★ 养老又护肝，时间斗士获得一切<br/>★ 装备鉴定全随机，英雄合成靠欧气<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我是猫步游戏的大头，是猫步游戏老板+古代战争制作人。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>另外，古代战争所有的传记剧情，都是大头我一个人写的（顺便兼职了文案策划~），这是我最自豪的事情啦哈哈！希望你们会喜欢我写的传记哦！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>欢迎游戏内点击一键加群，进入Q群向我们提建议和反馈问题，感谢TAP玩家对我们游戏的帮助，我会用体验良好的游戏来反馈大家，一如既往，爱你们哟（づ￣3￣）づ╭❤～"
                            },
