                            "whatsnew": {
                                "text": "<div>7月14日，忍者必须死系列十周年版本开启。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【武器】<br/>1、挥毫泼墨、笔走龙蛇，传说级水系SSR武器「龙毫笔」全新上线。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【关卡】<br/>1、忍者必须死系列十周年限定关卡上线。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【忍阶】<br/>1、忍阶拓顶，新增忍阶「绝忍」。<br/>2、新增特殊忍阶「鹰扬」、「云集」。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【活动】<br/>1、十周年豪礼来袭，四系强力SSR武器免费选一。<br/>2、时光邮局开启，写一封致未来的信，即可领取结神符。<br/>3、全新玩法「海音奏鸣曲」上线，通关BOSS获得代币，兑换奖励。<br/>4、十周年宝库开启，刷新奖池进行抽取，有机会获得自选SS图卷等神秘大礼。<br/>5、全新活动「游园手信」开启，参与庆典获得代币，抽取纪念品。<br/>6、忍魂重燃上线，招募战友获取奖励。</div>"
                            },
                            "description": {
                                "text": "战斗竞技与动作跑酷的完美结合，移动平台上绝无仅有的酷炫游戏体验，风靡全球的忍者必须死系列全新力作！<br/>《忍者必须死3》传承了前作备受好评的美术风格与核心玩法，并对跑酷游戏和横版动作游戏进行了全方位的融合和革新, 真正定义了“动作战斗跑酷”这个全新游戏类型，致力于带给玩家全方位、多层次的游戏乐趣。<br/>独创实时战斗跑酷模式，组队厮杀、合作制敌、家族对抗…诸多原创玩法，点燃战斗狂潮。多样化游戏体验，对战BOSS、空中决斗、限时逃脱、切水果…每一次挑战，都能给你带来新感觉。<br/>在忍者的世界里，聆听唯美古风与现代摇滚巧妙结合的雅音潮乐，品味东方水墨和日式漫画完美结合的独特画风，电光石火之间，手指腾挪，自重重暗器和刀光剑影中杀开一条血路，开启一场爽快炫目的唯美大冒险！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏背景】<br/>三百年前，来自鬼域的鬼族打开罗生之门，入侵阳世。顷刻间，大地崩裂，苍生涂炭！在这场旷世灾难面前，有两位英雄站了出来，带领人们击退鬼族并封印了鬼王。<br/>为了重建人们的家园，并带来长久的和平，英雄们一起建立了和之国。而他们的后人，化身代表光辉荣耀的武士和象征月之暗面的忍者，共同守卫着这个国度。<br/>三百年后的今天，作为统治阶级的武士早已腐朽堕落，他们畏惧忍者那恐怖的力量。猜疑和仇恨，让承平日久的和之国走向了战争的边缘，而被封印百年的鬼族，也悄然露出了爪牙……<br/>作为一个初出茅庐的萌新忍者，你将见证忍者与武士上百年的恩怨纠缠，直面在阴暗中窥伺人世的神秘鬼族，与扬起叛旗的天才少年展开无尽的宿命螺旋，亲手揭开一个个悬念与阴谋...<br/>血与火铸造的新时代即将到来，你的忍之魂，准备好燃烧了吗？<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【关注我们】<br/>官方微信：忍者必须死3 renzhebixusi3<br/>官方微博：@忍者必须死3 <a data-type=\"bbcode-no-link\" href=\"https://weibo.com/rzbxs\" data-origin-href=\"https://weibo.com/rzbxs\">https://weibo.com/rzbxs</a>"
                            },
