                                "text": "《开间小店》是一款现代模拟经营类手游。在游戏中，玩家拥有一家咖啡厅，通过自己的努力，从专卖咖啡做起，不断丰富菜谱，一步一步将咖啡厅建造为自己梦想的咖啡厅。玩家可以通过顾客挑战打分，获得各种游戏材料和货币，可以招募员工壮大自己的团队，除此之外，还有员工自动配餐、设备升级、玩家手动配餐等玩法，可以为玩家带来提升人才和设备的材料。通过游戏，玩家能获得经营策略思维的锻炼，体验创业的乐趣。"
