                            "whatsnew": {
                                "text": "<div>1.部分玩法平衡性调整；<br/>2.部分功能玩法优化；<br/>3.异常问题修复；</div>"
                            },
                            "description": {
                                "text": "《三国志奇侠传》是一款收集养成类的开放式角色扮演游戏，玩家扮演一个身世坎坷的小道士在乱世中寻找失散的妹妹。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>在此过程中小道士不断探索世界，经历种种或熟悉或陌生的事件，看到了很多潜藏在历史脉络之下的隐情，他试图通过自己的不同选择推动着历史车轮向不同的方向滚动。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>然而经历了红尘中的喜怒哀乐，悲欢离合，会尽了天下英雄，却还是无法憾动天道，迷雾之中仿佛有一只大手在操控着一切，小道士心中惘然。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>迷失了自己心中的“道”，成道成魔便在你一念之间！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【复古画风，再现儿时经典】<br/>游戏使用了90年代和20世纪初非常经典的像素RPG画风，并重新绘制了高请的人物头像，让玩家在感受到满满的儿时回忆。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【正史轶闻，追寻史诗剧情】<br/>游戏的剧情主线改编自《三国演义》，并揉合了大量的正史，野史和轶闻，让玩家不时能看到熟悉的故事，又获得了很多全新的知识。并且，在游戏中，主角的选择无法憾动历史的车轮滚滚向前，却可以直接影响一个个与之有关的人物的生死哀乐。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【沙盒世界，无限自由探索】<br/>游戏没有过多对玩家的限制，过了新手剧情之后，玩家便可以自由选择接下来的游戏方式，或推动剧情，或四处闲逛，或收集资源，或发现人才，或培养武将，或种田植树，或跑商游戏历，或体验小游戏。总之，这是一个自由的游戏，不是一个一步步都设定好的传统手游戏。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【名将贤士，体验收集培养】<br/>游戏中出现大量历史爱好者耳熟能详的历史名将出现在全国各地，玩家可以通过推动剧情或者战斗来收服名将，打造出属于玩家自己的“全明星”阵容。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【多样装备，任君搭配选择】<br/>武将除了自身的成长之外，还有多种多样的武器装备可供使用，装备不仅对武将的属性有加成效果，在战场中还会对己方士兵或者武将附加技能效果<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【种田挖矿，各种趣味游戏<br/>游戏中除了经典的RPG玩法之外，还有着很多休闲玩法，玩家可以在野外种树开矿，也可以化身摸金校尉在密道古迹中解开一道道难题，获得惊人的宝藏。"
                            },
