                                        "whatsnew": {
                                            "text": "<div>添加了一些新的配方和物品<br/>修复了排行榜不显示名字的错误<br/>你现在可以屏蔽其他用户的发言了<br/>优化游戏执行效率降低卡顿</div>"
                                        },
                                        "description": {
                                            "text": "沙盒勇者是一款像素风格的沙盒游戏。玩家将在怪物洗劫后的废土中重建村庄，自由设计你的要塞，部署防御建筑，招募同伴帮助你对抗怪物，收集隐藏的宝藏打造强力装备，提高自己的实力。技能装备自由组合搭配，根据情况及时改变战略，挑战最终的魔王拯救魔法大陆。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>没有规则超自由的玩法，还有各种建筑物的创造带来脑力上的竞技乐趣；复古像素风格的画面场景，充满趣味的冒险挑战，让你游玩更加精彩；酷炫技能，不一样技能天赋加点，作战刺激性不凡，击败各界的大神；各种各样的生态生物充斥在游戏里，在不同的世界获得不同的游戏享受；"
                                        },
