                                        "whatsnew": {
                                            "text": "<div>2022年7月29日更新内容<br/>1、全新养成--本命法宝开放上线！<br/>--本命法宝可对现有的法宝进行效果追加，并拥有对特定职业加成的效果；<br/>开启条件：开服第45天且达到散仙境开启<br/>入口：主界面-法宝栏<br/>2、混沌魔墟增加了“魔界主宰”，可掉落本命法宝相关的材料；<br/>3、魔域之战、无尽火域快速扫荡弹窗增加再次扫荡功能；<br/>4、聊天增加了系统频道；<br/>5、优化了战阵培养界面，现在在战阵中培养时可以直接进行伙伴切换；<br/>6、调整了仙斗坊市中“魔墟探索令”的售价；<br/>7、调整了部分历练副本的难度；<br/>8、调整了第3层中灵路试炼的难度；<br/>9、降低侍女拜访的冷却时间；<br/>10、优化洞天福地的闪烁提示；<br/>11、优化了我要变强相关指引，与部分界面的详情显示；<br/>12、优化部分活动投放</div>"
                                        },
                                        "description": {
                                            "text": "本是21世纪的地球人，因一次旅游意外获得遗失百年的奇门玄书。凭借真经的力量，突破了位面限制，了却前世尘缘，轮回步入转世，睁眼已穿越进入修真世界。在这人、灵、魔、妖共存的世界，独自一人该何去何从？漫长修仙路上，独自一人是孤独的是寂寞的。<br/>修仙路上你会邂逅诸多绝世伙伴和他们发生许多有趣的事。随着你的修为的提升，将会逐步推进故事剧情的发展。了解好友的过往，解开伙伴身世。帮助好友摆脱废物之名，夺得心爱女人的芳心。<br/>前世生而为普通人碌碌无为，这一世我要夺天地之造化，君临天下！！<br/>在这里你可学得五行八卦，巧夺天地灵气，无中生有，从而炼制法宝、法器、炼丹。闯荡修行探寻上古遗迹，历练修为实力，前往仙灵大陆寻找各类异能神兽，挑战万千星界之主勇夺天材地宝，与一代代聪明才智之士，在这修真世界，万道争锋，谁才是最强的王者！"
                                        },
