                                    "contents": {
                                        "text": "渠道服，20年七月入坑，因为高考退游了将近一年，从退游时的三期回来直接开五期了，听说小加加出婚皮了，直接爱死，这游戏真的很耐玩，我玩过方舟，少前等等十几个游戏，但最后留下的只有碧蓝和原神，真的很好的一款游戏，不论是从抽卡爆率，资源获取，还是音乐美术，都是十分符合我审美的<br />而且这游戏你就算是一些蓝皮，紫皮都可以推图，而且满破完全是轻轻松松，和一些游戏比起来太良心了，这也是我见过唯一一个评分9.5以上的游戏，可以说是零差评",
                                        "raw_text": "渠道服，20年七月入坑，因为高考退游了将近一年，从退游时的三期回来直接开五期了，听说小加加出婚皮了，直接爱死，这游戏真的很耐玩，我玩过方舟，少前等等十几个游戏，但最后留下的只有碧蓝和原神，真的很好的一款游戏，不论是从抽卡爆率，资源获取，还是音乐美术，都是十分符合我审美的\n而且这游戏你就算是一些蓝皮，紫皮都可以推图，而且满破完全是轻轻松松，和一些游戏比起来太良心了，这也是我见过唯一一个评分9.5以上的游戏，可以说是零差评"
                                    },
