                                        "whatsnew": {
                                            "text": "<div>1. SDK功能升级<br/>2. 客户端性能优化<br/>3. 修复目前已知问题</div>"
                                        },
                                        "description": {
                                            "text": "《碧蓝航线》是一款集即时海战、少女养成及多种社交休闲玩法为一体的手游。由中日画师阵容倾力打造，超过150位性格各异萌点十足的小姐姐等待出击，为你而战！游戏采取双排式策略作战方式，配合即时战斗模式，真实还原海战临场感，带你体验全新的操作乐趣！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>在近71%的表面被海水覆盖着的蓝色星球，人类的文明伴随着海域成熟发展。而一切的平静被突然出现在海洋中的未知敌人——拥有压倒性战力的神秘敌人“塞壬”打破。为了夺回曾经的辉煌，白鹰、皇家、铁血、重樱等几大阵营联合起来成立了第三方军事组织“碧蓝航线”，奔赴战场的前线……<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏特色】<br/>--即时海战，感受充满张力的临场感！<br/>从最细微的惯性系统到爽快的全弹射击，从规避致命伤害到予以敌方痛击，让指挥官们如同置身瞬息万变的战场上，运用精妙的策略搭配和灵活的操作，在遮天蔽日的炮火中为人类的未来开辟新的道路！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>--强大的中日画师阵容，塑造各色魅力少女！<br/>汇聚了中日画师团队。御姐、萝莉、邻家少女……超过150名性格萌点各异的小姐姐！ 静待指挥官您的命令！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>--养成与收集 丰富要素等你发掘！<br/>丰富有趣的后宅系统，数百种家具随意DIY，打造属于指挥官与少女们的乐园；特有的手办收藏系统，让小姐姐们填满属于自己的手办柜吧！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>--最激烈的PVP，争夺无敌舰队之名！<br/>陷身历史与战火的齿轮，与其他指挥官实时交锋，改变世界格局！证明自己的时候到了！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>--超豪华声优阵容（排名不分先后）！<br/>上坂堇、雨宫天、堀江由衣、田中敦子、福原綾香、山本希望、篠田南、大地叶、桥本千波、优木加奈、加隈亚衣、桑原由气、长绳麻理亚、阿部里果、白壁爽子、河野洋美、横田彩、吉冈香织、山根希美、石川由依、五十岚裕美、篠原成美、御手洗果林、中条智世、佐仓绫音、佐久间比吕美、Maia。"
                                        },
