                                        "whatsnew": {
                                            "text": "<div>Hi 大家好，<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我是Noam, 《迷宫大侦探 Labyrinth City》 的创作人。<br/>今天我想和大家分享一下我们的创作背景和心得～ 说实话制作这个游戏真的是机缘巧合。有次逛街，我无意中发现了IC4DESIGN的《Pierre The Maze Detective》。当时我只是随手拿起这本书，但是当我拿起的那刻起，就很难再放下了。《Pierre The Maze Detective》的图画精致且富有童趣，让我一下回想到了童年时看着这些绘本的快乐。于是我忽然就突发奇想 —— 我想把这本书和游戏结合，制作出一款充满返璞归真的迷宫探索游戏。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>然后我立刻就开始搜罗团队成员，准备制作。我也很快地就联系上了IC4DESIGN，他们特别积极地同意了我们的合作改编要求，为我们提供了图画的版权和所需材料。和他们一起的整个合作都很顺畅轻松，我想无论是我还是团队里的每个人，都在整个过程中挖掘到了自己已经沉埋多年的童心。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>但这不代表整个游戏制作过程中我们没遇到过任何的困难。其实这本书在改编之前已经是国际上知名的畅销儿童绘本了，所以我们在游戏改编的时候，为了让他更新且更有趣，费劲了心思。在多次思考和尝试后，我们在游戏里添加了许多书里没有的内容（如音乐，不同的故事层次，剧情等等），而这些都是为了让玩家能有更好的游戏体验。 与此同时，我们也希望让游戏中的NPC都活起来，而不是作为单独的背景。我们为许多NPC人物都设定了自己的性格，并为他们加上了动画和对白。但这些就都留给大家亲自去体验吧，我就不多说啦～<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我们认为书本是平面且单项的，但游戏不是。我们希望通过游戏，将这本《Pierre The Maze Detective》从一本书改变成一个宇宙，让每一个玩家都像新来到这个世界的小baby一样，自主地探索和挖掘。 《迷宫大侦探 Labyrinth City》是我们Darjeeling的诚挚之作，我们希望可以把这个充满童趣的宇宙带给你们。也希望你们在这个宇宙中体会到我刚刚读到《Pierre The Maze Detective》时的纯粹的快乐！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>谢谢，<br/>Noam</div>"
                                        },
                                        "description": {
                                            "text": "2020年 IndieCade视觉大奖获得者，Game Connection Asia国际游戏展亚洲区最佳艺术风格奖获得者，indiePlay 最佳海外作品奖入围～ 独特画风 精美关卡～ 现已开放TapTap预约及Steam Wishlist啦～欢迎大家把我们加入自己的预约和心愿清单哦！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【简介】<br/>大事不妙！博物馆的魔法宝石被江洋大盗Mr. X偷走了！ 为了寻回丢失的宝石，大侦探Pierre必须踏上一条穿越迷宫的不归路。绕过层层阻碍，穿过艰难险阻，大侦探Pierre势在必得！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏介绍】<br/>《迷宫大侦探 Labyrinth City》(全名 《 迷宫大侦探 Labyrinth City: Pierre the Maze Detective》）改编自畅销书《Pierre The Maze Detective》，在本款游戏中，你将穿越10个画风精美的地图，寻找大盗Mr. X。在寻找的路上，你可以通过与路人互动，抽丝剥茧挖掘支线故事的层层细节。与此同时，你也可以在地图中收集寻宝，挖掘意想不到的惊喜哦～<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏亮点】<br/>-改编于IC4Design大热儿童绘本《迷宫大侦探皮埃尔》，精致的童趣手绘画风带你进入充满生活和错综复杂细节的多彩世界!<br/>-超过100个收集物件及隐藏解谜游戏，地图风格各异，暗藏玄机。<br/>-500+个互动点，让游戏中的背景、物件和人物愈发生动起来~<br/>-原创音乐，带你梦回童趣世界！<br/>-故事剧情扑朔迷离，体验追踪嫌犯找回宝石的全过程并破解趣味谜题！<br/>-支持简繁中文、英文、法语、德语、日语、俄语、西班牙语、意大利语、韩语等多种语言。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>迷宫大侦探 Labyrinth City 官方QQ群现已开通，群号645020246，欢迎各位大侦探的加入！"
                                        },
