                                        "whatsnew": {
                                            "text": "<div>加入3个新的挑战，平衡，修复bug</div>"
                                        },
                                        "description": {
                                            "text": "《神州志：西游》是一款地牢冒险卡牌策略（roguelike+DBG）游戏。在游戏中你将扮演西游记中的传奇人物，利用卡牌、消耗品、法宝和同伴，一路闯关降魔，主宰神州大地的命运。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【经典卡牌构筑玩法】<br/>经典的卡牌构筑玩法，200+张卡牌，100多种消耗品，200多个法宝，组成千变万化的流派，每一次旅程都有新的惊喜！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【团队作战乐趣翻倍】<br/>西游旅途，你并不孤单！在商店、休息区或者突发事件中都可以招募到投缘的同伴，相互扶持，共同进退，独乐乐不如众乐乐。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【高自由度的英雄养成系统】<br/>炼丹，附魔，天赋，偷窃和召唤 - 养成系统让每一个英雄的玩法更加多种多样。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【忠于原著的中国神话背景，每个角色都生动有趣】<br/>主线故事脱胎于西游记，悟空，玄奘，八戒，沙僧，小白龙，牛魔王，白骨精……每一个英雄和对手，都有着自己的喜怒哀乐。每一次旅程你都会遇见不同的同伴和事件，每一个选择都将影响神州的最终命运。"
                                        },
