                                        "whatsnew": {
                                            "text": "<div>tap试玩节包体</div>"
                                        },
                                        "description": {
                                            "text": "《山河旅探》是奥秘之家开发的一款国风横轴本格推理探案游戏。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏简介】<br/>凡有接触，必留痕迹。世间绝无真正完美之犯罪，唯有未被发现之线索。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>清末民初--古代与现代、东方与西方多种文化交融碰撞的风云年代，化身故事主人公的你，被卷入了一场无法避免的阴谋案件之中。看似并无关联的种种事件，却将你推向了一个巨大的悬案旋涡和身份之谜。<br/>谎言是经过伪装的事实，而你能否抽丝剥茧，从堆叠的案件中推导出最后的真相？<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏特点】<br/>=====逻辑严谨的本格推理=====<br/>旅行途中你会遇到一系列匪夷所思的案件，而种种案件的背后，都需要你根据故事的发展来，控制主人公在不同场景之间的自由移动，从而寻找蛛丝马迹。<br/>你会需要勘查现场、找寻证物、询问证人，利用游戏中收集各方线索，推断案件的原委与真凶，甚至，你还要找寻获得证言中的种种漏洞……<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>======波澜诡谲的剧情案件=======<br/>不同地点看似并无关联的桩桩案件，实则与主角背负的主线大案有着千丝万缕的联系。<br/>每桩案件背后，都隐藏着精妙绝伦的作案手法和令人唏嘘的作案动机。看似简单的人物，又隐藏了无数错综复杂的纠葛。而你，能否抽丝剥茧，找到大案的最终真相，完成自己的复仇？<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>======扑朔迷离的开放式支线案件====<br/>除了主线案情之外，游戏中还有一系列开放式“悬案”等你破解。<br/>你会偶遇特殊事件，触发隐藏剧情，并通过自己的判断获得不同的故事走向。而这些没有唯一答案的悬案，等待着推理迷们来各抒己见！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>======赏心悦目的国风水墨画卷之旅=====<br/>沿着徐徐展开的水墨卷轴风景画，我们共同游历百年前的祖国山河。<br/>泛舟洞庭湖之上，与岳阳楼回首相遇；沿长江航行，探索蒸汽朋克感十足的汉阳钢铁厂；百转千回，扬州的江南烟雨，上海的复古摩登…期待你在每一帧场景都可以成为壁纸的画卷中，领略风土人情、破解各地谜案。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>=======精心考据的历史人文设计=======<br/>游戏的整体设计和画风上，我们考据了大量的博物馆史料、老照片、与文史专家深度交流。整体故事以当时的史料事实为依据，还原百年前的建筑样式与地方风貌。考究的人物服饰和物品装扮，也一定会让你在游戏中感受到清末民初的历史人文风貌。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>欢迎加入山河旅探游戏交流群：238893223"
                                        },
