                                        "whatsnew": {
                                            "text": "<div>剧情活动「妖怪图鉴编纂记」后篇 火热进行中！<br/>1、开启限定活动「妖怪图鉴编纂记」后篇部分；<br/>2、领主战追加「妖狐」；<br/>3、开启限时活动「多人领主特选」。</div>"
                                        },
                                        "description": {
                                            "text": "《世界弹射物语》（World Flipper）是一款由Cygames和其子公司Citail共同开发的动作手游新作，在本作中，玩家将通过瞄准目标，弹射角色来打败敌人。游戏中有着多种多样的角色，巧妙地利用不同角色的技能和特性，使出精彩的组合技，来华丽的打败敌人吧。同时，玩家还可以通过多人合作的方式，与伙伴一同挑战强大的领主，赢取更加丰盛的奖励！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【点击屏幕 突进冲刺！ 发动技能 击败阻碍前路之敌！】<br/>本作的战斗是基于弹珠台的战场，由三名出战角色组成，在战斗中点击屏幕来启动弹板弹射角色，通过撞击敌人来造成伤害的同时积累角色技能能量，通过释放角色技能来造成更强大的输出，击败各种各样的敌人！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【伙伴联手 协作战斗！ 合作无间 触发强力技能连携！】<br/>游戏的另一个特色便是共斗玩法，游戏中玩家可以在领主战界面选择组队挑战形式，邀请自己的好友或者与陌生伙伴一起挑战强大的领主。当队伍中的玩家段时间累积释放4个或以上技能时，便会触发技能连携（CHAIN）机制，在此期间不断释放技能则可以提高CHAIN计数，追加强大的技能连携伤害，为战斗带来更大的帮助！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【灵活多变 技能合击！ 策略搭配 组建最强王牌队伍！】<br/>通过主副角色技能搭配，可以将二者技能效果合并，打出变化多彩的技能合击。通过不同的技能组合，可以倍数级提高队伍的整体强度，组建自己最强的队伍来更高效的参与挑战！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【多彩篇章 梦幻物语！ 华美音符 编织幻想弹射世界！】<br/>游戏有着高超的像素动画表现，由豪华制作团队倾力打造的复古与革新并存的像素梦幻史诗。伴随着优美的音乐，与阿尔克、史黛拉和莱特一起通过世界弹射器前往不同的世界冒险，邂逅新的伙伴！"
                                        },
