                                        "whatsnew": {
                                            "text": "<div>1.增加成就系统（新开档）<br/>2.增加超级海王类 象主<br/>3.钓鱼协会增加了一个NPC神秘商贩<br/>努力制作新游戏中。。。</div>"
                                        },
                                        "description": {
                                            "text": "正所谓&#34;大千世界，无奇不有&#34;，这是一个神奇的世界，千奇百怪，光怪陆离<br/>你可以看到有人在使用魔法，也会发现有人在使用道术<br/>你可以看到爱打篮球的坤坤，也可以品尝到美味的奥利给<br/>你可以和异世界的妹妹们来一场邂逅，也可以和抠脚大汉们一同冒险<br/>你可以在某个城镇来一次美妙的特殊服务，也可以在世界的各个角落寻找遗失的宝物<br/>故事发生在一次&#34;大灾难&#34;之后的千百年，当你睁开眼时发现你已经不属于原来的世界，而是来到了这个&#34;大千世界&#34;<br/>你要不断的变强不断的赚钱，让你有足够的能力在这个世界上生存下去，并揭开这个世界上的重重迷雾...<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏特色】<br/>1.开放世界，自由度强。<br/>2.主线剧情想做就做，不想做就先不做，不像老式RPG这个任务不做完你连这个房子都走不出去<br/>3.全新门派系统，你可以加入各种门派学习绝学，亦或是当一名独立冒险者<br/>4.中国风好，还是西方魔幻好？中西合璧！这个世界上你可以学习魔法，忍术，道术等等，真正意义上的一个世界<br/>5.装备系统独特且强大，数千种装备，精细设计，绝不是通过随机附魔来取巧<br/>6.无职业！角色方向自己搭配，角色定位自己来决定<br/>7.多种副职业，&#34;锻造，裁缝，制皮，附魔，炼金，工程，符箓，制毒，制蛊，烹饪&#34;等等，让你的游戏之旅更为丰富<br/>8.好人坏人自己定夺，你可以在游戏中扮演一个正义凛然的角色也可以当一个邪恶无比之人<br/>9.自由任务，同种任务多种解决，世界上的每一件事都会因为你的抉择而改变<br/>10.好听的BGM，让你身临其境，玩别的游戏都不想听BGM，但这款不同！<br/>11.要写可以再写一万字，不如下载玩一玩，真的顶！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>●最低配置要求：<br/>移动端：高通骁龙710或同级别处理器、至少4G运行内存，32G存储内存。<br/>PC端：英特尔5代酷睿或同级别处理器，至少4G运行内存，250G存储内存。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>●推荐配置要求：<br/>移动端：高通骁龙855或同级别处理器、至少8G运行内存，64G存储内存。<br/>PC端：英特尔i5-8750H或同级别处理器、至少8G运行内存，500G存储内存。<br/>（以上配置需求为独立制作人列王守卫提供，以及一些独立制作人陆琦的建议大家也可以去玩玩他们家的游戏）"
                                        },
