                            "description": {
                                "text": "《保卫萝卜1》是一款制作精美、真正可爱范儿、全世界的口碑都极好的超萌单机塔防手游~~！！！ 原创萝卜IP，经典的卡通画风，多变的战斗策略。这款游戏不仅容易上手、老少皆宜，而且能够给你带来无穷的乐趣！<br/>你的任务就是保护好可爱的萝卜，别让怪物吃掉它哦~~<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏荣誉】<br/>-appstore进入超过70个国家总榜、游戏榜TOP10~~<br/>-在整个亚太地区各市场排行榜TOP1-TOP5，欧美地区43个国家TOP25，被全球101个国家推荐为“热门游戏”~~<br/>-短短100天超过1000万次下载，好评如潮！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏特色】<br/>-105个关卡，5套精美的主题包，从天际到丛林、沙漠，再到深海！<br/>-35张极限模式、隐藏关卡等你来发现！<br/>-16关独一无二的创新BOSS模式地图，让塔防通过限时MINIGAME方式玩出花样、玩出乐趣！<br/>-18个风格独特的防御塔，鱼刺塔、太阳花、便便塔、船锚塔…。。更多花样等你探索~<br/>-20个精美怪异的怪物蛋等你来发现和搜集！<br/>-怪物养成系统，把收集来的怪物蛋孵化成萌死人的怪物宝宝，把它们养大后将会解锁隐藏地图！<br/>-地图上精美的障碍物里，藏着许多宝贝和惊喜，打掉它挖掘宝藏吧！<br/>-70+个搞笑滑稽的怪物，它们有着奇怪的名字:Woowala、Pinky Ninja 、Twisty Fork……<br/>-100+ 滑稽的音效，每个怪物和塔都会发出独特有趣的声音！<br/>-每个关卡只有15-25波怪物，碎片时间就可以玩的很过瘾啦！<br/>-精美的游戏画面，全新的策略性，可爱的萌系萝卜，总有一个你喜欢的点！<br/>-如果你没有Wi-Fi，那也没问题，离线玩畅通无阻。"
                            },
