                            "whatsnew": {
                                "text": "<div>《猫之城》将于2022年7月20日开启全平台公测。<br/>猫咪即正义，情绪即力量！</div>"
                            },
                            "description": {
                                "text": "《猫之城》是由番糖游戏自主研发的一款猫拟人潮酷都市策略RPG。在这个世界里， “情绪”变成了一种可视化物质， 神秘猫族将“情绪”转化成了新的能量、物质， 甚至是可用于作战的“情绪武装”。你作为调查官， 带领猫族小队， 调查城市中出现大量情绪病背后的真相……<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>未来都市，情绪暴走，暗潮涌动迷雾重重<br/>近未来科技都市，3D次世代卡通渲染，轻赛博风暴强势袭来。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>神秘猫族，武装出击，探索异变背后的秘密<br/>隐藏在都市中的猫族，形态切换抵御暴走，3D炫酷大招演绎。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>灵活卡组，独特战斗，运筹帷幄协力作战<br/>自由组合技能卡，合纵连横策略操作，打破玩法单一可能性。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>撸猫闲聊，线上吸猫，抚慰焦躁暴动的情绪<br/>云养猫，和猫猫共度闲适日常，感受陪伴治愈的情绪能量。"
                            },
