                            "description": {
                                "text": "【福利看开发者说】三国策略攻城手游，白嫖T0级别红将！养肝自动推图，周周2W+元宝资源拿到手软！豹子头零充也能玩的很爽！<br/>特色兵种+专属武将任意组合，随时战个痛快，三国美人抓回家！！更多福利尽在日常活动！<br/>全尺寸大地图，自由攻城掠地，策略兵种搭配，多样武将特色加成，和兄弟一起攻下江山！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【白嫖真香】<br/>开局连登录就能白嫖连抽、顶级红将和海量资源！开局就能乱杀，微氪首冲百万战力直接起飞！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【巨量产出】<br/>每周珍稀材料、城池特产、精英怪产出资源加倍！资源多到武将随便升，潘凤也能打吕布！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【酒池肉林】<br/>珍兽、全民赛马、海量休闲养成小游戏，闲暇就回后宫和美人调教嬉戏！还可邂逅邀约美人，红尘一笑，独醉逍遥！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【豪情国战】<br/>不用担心无菜可虐，全尺寸地图攻城掠地，完整而又沉浸的体验那段宏伟的历史！"
                            },
