                            "whatsnew": {
                                "text": "<div>1. 弦幻灵职业重大改动<br/>*弦幻灵职业普通攻击附带穿透效果，同时弦幻灵职业的普通伤害基数同步进行了平衡性调整<br/>*由于羿的被动与穿透效果冲突，重新设计了羿的被动技能，羿的群伤能力得到加强，适用情景更广，满级技能对比如下：<br/>原技能：普攻时10%概率转化为3只112%伤害的单体伤害箭矢并灼烧<br/>新技能：普攻时10%概率额外射出3只74%伤害的穿透箭矢并灼烧<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>*由于狰的被动与穿透效果冲突，重新设计了狰的被动技能，狰的辅助效果得到加强，对火元素体系增幅更加强力，满级技能对比如下：<br/>原技能：普攻时有15%概率触发5次弹射，每次造成33%伤害<br/>新技能：普攻时有8%概率造成灼烧，并使目标受到火元素伤害提高20%<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>2. 灵阵初开消耗调整<br/>*作为备受关注的灵阵初开新手卡池，由于贤灵珠的获取限制，无法尽早完成抽取，故将消耗贤灵珠调整为等价灵石。给大家更多选择权力。<br/>调整后，已抽取的灵阵初开部分不受影响，未消耗的贤灵珠可手动在包裹中分解为240灵石<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>3. 平衡性调整<br/>*无常PVE小技能增加了短暂禁锢效果<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>4. 宴会时间调整<br/>*部分玩家反馈宗枢宴会时间较短，容易错过奖励，宴会持续时间调整为8小时，请宗枢会长注意改动，合理安排宴会时间<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>5. 元素组合界面优化<br/>*可以查看元素组合的完成进度<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>6. 竞技场战报优化<br/>*竞技场战报可以查看被演习的结果<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>7. 修复了专属礼包消耗玄玉未二次确认的BUG<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>8. 修复了宴会奖励中装备错误的问题<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>9. 优化了部分体验<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>10. 修复了部分已知BUG</div>"
                            },
                            "description": {
                                "text": "《幻灵师》公测7月15日 10点已开启<br/>首发推迟致歉礼包：HLSYQDQ<br/>首发助力礼包1：HLS6666<br/>关注公众号：幻灵师手游，领福利礼包。<br/>首发延期礼包：HLSYQDQ<br/>----------3D国风策略卡牌塔防手游---------<br/>关注公众号：幻灵师手游，领福利礼包。<br/>----------3D国风策略卡牌塔防手游---------<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>------幽冥地府------<br/>『迷路的鬼魂，不听话？小心被那可恶的秃驴给丢入忘川河中……』<br/>『我佛慈悲，普度众生，贫僧还有要事，先行一步……』<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>一望无际的幽冥河畔，少女气急败坏的指责着亡灵<br/>拒人千里的勾魂使，静静在不远处，望着少女与鬼魂戏谑玩闹……<br/>远去的僧人，周身业火，脚束枷锁似乎从不影响他一心向佛的步伐！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>------清水河畔------<br/>『脸，好美，我的，都是我的……』<br/>河畔轻倚着一位身姿优美的女子，洁白的玉足轻点水面，呢喃声随风缓缓传来，夹带着丝丝凉意！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>------暗夜森林------<br/>『你的心上人，还没得到吗？』<br/>寂静的深夜，湖面泛着粼粼波光，映照着她骨爪裂骸轻扶的脸，美艳的脸庞上时而温柔，时而疯狂怨恨！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>…………<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>水火土雷风光暗元素交织的神魔三界，散落着许多远古遗族，被统称为幻灵，他们与生俱来强大元素之力，也受天道规则所约束，某天，他们突然受到了一股强烈的召唤，脱离束缚千万年的地方，来到了某人身边……<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>传闻，人间至圣鬼谷子曾收养了一名婴儿，亲力教导，其修行的无上秘法唤为--幻灵术，一段幻灵师与幻灵们并肩作战的冒险故事从此展开！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我们有高颜值的外表：<br/>百张灵动幻灵立绘，搭配唯美精致的场景，高颜养眼，带你欣赏异世界各地域的绝美风貌！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我们有灵动贴脸的配音：<br/>萝莉、御姐、女王、正太、冷峻、温润，你想要的声音我们都有，独具幻灵特性的配音带你感受异世界沉浸式旅程！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我们有动人的传奇故事：<br/>不仅记录了幻灵们的身世来历，揭晓幻灵与幻灵之间奇妙的缘分羁绊，还有隐藏着神秘的暗势力等待幻灵师们破解哦~<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我们有百变的策略玩法：<br/>经典塔防战斗模式，搭配创新元素玩法，不同职业的属性克制／站位攻略的策略搭配，以及不同元素技能先后释放产生超级强悍的技能合击技，酷炫的特效画面，给你酣畅淋漓的战斗体验~<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>依托卡牌策略性，延申多种pvp玩法与多人组队副本，无废卡养成，各角色均有适宜的发展性，无论是属性克制，还是技能克制，或是羁绊buff,所有阵容重在上阵角色的策略搭配组合，最强阵容等你挖掘~<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>--------联系我们--------<br/>客服QQ：800066614<br/>官方Q群：785516205<br/>"
                            },
