                            "whatsnew": {
                                "text": "<div>《地铁跑酷》邀请各位跑酷者暑游自由湾区旧金山，开启夏日之旅，决战夏日冠军赛，竞逐巅峰荣耀！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>1.彩虹赛道，梦启金门<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>从金门大桥出发，感受彩虹之城的魅力！维多利亚式的屋宅排列在起伏有致的赛道右侧，左边是一望无尽的北太平洋。在朝阳照耀、现代感与古典美兼备的自由湾区，向着风迎着彩虹奔跑，各位跑酷者将充分感受夏日清凉。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>2.玛雅登场，拓普疾驰<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>来自旧金山的新跑酷者「玛雅」即将上线，新滑板「拓普」不仅拥有强大的超级跳跃能力，加上瞬间移动的双重技能，疾速飞驰的能力可是相当惊人，用实力助力大家逐梦淘金城。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>3.夏日之旅，海星闪耀<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>每日通过无尽模式跑图及完成挑战任务，收集足够数量的Q弹小海星，可获得旧金山城市限定角色、滑板、专属自选道具等奖励。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>4.分数争霸，一战成名<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>分数争霸赛再度回归，跑酷者们可以在无尽赛道中冲刺高分挑战，和自己的极限记录进行比拼。排行榜将会根据跑酷者们的最高分数进行排名，排名前列可抱走地铁跑酷实体周边！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>5.决战夏季，打榜应援<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>夏日冠军赛，竞逐巅峰荣耀！跑酷者们皆可报名参与，万元现金大奖、全新赛事专属角色「夜莺」&amp;滑板「月羽」，还有超多奖励等着大家！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>赛事对决，打榜应援！这场赛事对决想邀请你见证每一位参赛者的辉煌。参与鲜花榜为参赛者打榜应援，助威冲进决赛圈，达到规定的打榜数即可领取限定新角色「超级琪琪」，蓝钥匙等福利礼包不容错过！</div>"
                            },
                            "description": {
                                "text": "《地铁跑酷》暑游旧金山！在北太平洋环绕、彩虹照耀的全新赛道上，来自旧金山的新角色「玛雅」踏上新滑板「拓普」疾驰淘金城。「夏日之旅」活动盛大开启，完成收集海星任务可兑换限定道具，「分数争霸赛」惊喜回归，累登7日可获旧金山限定头像框赠礼，另有旧金山特卖礼包限时开售。「夏日冠军赛」强势回归，竞逐巅峰荣耀，收获赛事专属人物「夜莺」、滑板「月羽」，打榜应援解锁新角色「超级琪琪」，夏日无限精彩不容错过！"
                            },
