                            "whatsnew": {
                                "text": "<div>宝子们，现在是Doris 电台为你播报<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>好久不见，你们想我们Doris电台了吗？我们回来了<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>现在为大家介绍期待已久的 《风.魔忍 VS 圣裁者·伊莉莎》版本<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>一、最受期待历史最强白嫖套装-风.魔忍现世<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>增加30日签到，可在30日的签到中逐步收集 风.魔忍套装，并且包含丰厚奖励，还有S级superbox哦<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>记得每日上线首页点击签到哟！！记得-7月签到30天！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>二、圣裁者·伊莉莎 活动来临，挑战新玩法，斩断罪恶，迎接神之圣裁！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>（1）新活动模式中增加神秘问号箱子，Death or Rewards? 请留意靠近黄色神秘箱子的特殊变换，做好的你的操作选择^(*￣(oo)￣)^<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>（2）SunnyGame全员为了各位Doris奶爸奶妈的肝功能着想，圣裁者·伊莉莎 活动回归转盘活动<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>（3）wait wait,大家更新后发现抽奖所需货币提高，千万别慌，是因为战场获取变得更容易了！！！布朗说要感谢帮助过Doris的你们，现在战场大放血！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>PS: 活动武器“断罪”的刀光真是满足了我们的暗黑少女哥特心<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>三、新增最强武器-鬼丸国纲<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>东海带来了风魔一族世代相传的最强魔刃，并把他藏进了Superbox，等待幸运儿的开启<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>PS:希望大家听听鬼丸国纲的武器配音，因为是真的帅！！！还有还有还有·····刀光也帅到爆炸了<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>四、新增白嫖武士刀<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>上线就送！上线就送！虽然是一把普普通通的武士刀，但我们觉得还挺帅的<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>五、新增7把绿色品阶武器（约等于免费送）<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>ε=(´ο｀*)))唉那么帅的武器居然是绿武，看来是变相的送福利呀，毫无压力购买<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>六、13幺、大四喜、魔法种子回归<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>累充奖励更新为 13幺、大四喜、魔法种子<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>七、增加SuperBox快速开启功能<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>最近接到很多布朗的投资人告知，100多个S箱子开着太慢，1W多supercoin抽着太慢了,所以特此为大家增加了快速开启的功能<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>八、优化<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>（1）优化AOE，取消AOE双倍加速<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>（2）优化活动战场特殊怪物出现机制，单道将不再出现特殊怪物（特殊怪物指-小熊及黄金问号箱子）<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>(3）优化战场UI，调整血条、玩家昵称、头像的位置<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>九、最后的白嫖<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>老忍者未拥有的玩家，上线即送！！！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>Doris电台播报结束，最后希望大家呼朋唤友，发起刀光与少女的最强战斗跑酷挑战吧！！！！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>十、区分了不同武器的音效<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>如有不一样的想法欢迎加入微信群参与热烈讨论“战斗少女跑酷官方”</div>"
                            },
                            "description": {
                                "text": "在被小丑侵略的世界里，一个喜欢自言自语的疯狂少女--Doris，独自与小丑们战斗着。她不担心世界的安危，更对其他人没有兴趣，只有战斗才能带来快乐，杀戮才能使其愉悦。故事就围绕着这名少女展开了。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>一： 杀敌，闯关，不要停下你的脚步！<br/>传统跑酷？NO！你也可以称我们为动作游戏！遇见敌人？攻击它！极致的打击感和操作感才是我们要传达的感受！这世界中没有什么不可击破~没有什么可以绊住你的步伐！暴力美学，创造出不可思议的游戏爽感！多种场景风格，感受完全不重样的游戏体验。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>二：冲刺，加速，感受速度与激情！<br/>跑酷游戏太平淡？那就加速冲刺！《战斗少女跑酷》增加了加速创新操作，下滑再下滑，加速再加速！感受在极限速度下的连续操作感和打击感吧！独特Fever模式，古典与杀戮，展现反差中的暴力美学。与此同时，游戏的关卡末尾，有轻松熊在迎接一路奋战的疯狂少女，暴力以外，可爱也必不可少！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>三：独特风格，超多搭配！<br/>超多套装与武器，随意搭配，尽情分享。<br/>还有小姐姐为疯狂少女Doris倾情献声<br/>疯狂萝莉杀戮前会说些什么？为她换装打扮后又会说些什么？一切尽在不言中哦！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>小丑与女孩的大战即将开始！你，准备好了吗？<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>是一款以战斗跑酷为主打的少女潮流换装游戏，国产跨平台国际跑酷游戏。装备风格多样脑洞大开！摆脱枯燥跑酷，重订竖版跑酷操作上限"
                            },
