                            "whatsnew": {
                                "text": "<div>调整操作手感，针对不同机型自动匹配灵敏度。<br/>减少了广告播放次数，现在只有首次进游戏和退出游戏的时候播放广告。中途大概5,6分钟才会播放广告了。<br/>去掉测试用的背景音乐。<br/>若干bug修改。</div>"
                            },
                            "description": {
                                "text": "2017 TapTap 年度最佳独立游戏提名<br/>GMGC 2017 IPA大赛亚军游戏。<br/>来自苹果月度最佳游戏，IMGA最佳创新游戏《谜途》的创作团队新作。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>我们是有爱的两人夫妻团队，喜欢设计有爱有创意的游戏。在大量同质化的商业游戏中，我们就像一页孤舟，载着我们对游戏的热爱，寻找玩家的认领~<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>制作初衷：<br/>我们觉得生活不应该是枷锁，而是一场心灵的奇幻探险旅程，以此题材创作了这个故事，希望能表达出打破枷锁迎接未知自由的一种内心体验。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>期待您与我们交流：<br/>玩家交流QQ群:375423673<br/>微博：@暖心游戏WarmHeartStudio<br/><a data-type=\"bbcode-no-link\" href=\"http://weibo.com/u/3120205027\" data-origin-href=\"http://weibo.com/u/3120205027\">http://weibo.com/u/3120205027</a><br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>故事梗概：<br/>小女孩桃乐丝因病终日与轮椅为伴，与外面世界失之交臂的她其实内心一直渴望着冒险。终于，精灵听到她的心声。将她带入神秘的梦境。玩家将跟随桃乐丝一起坠入几何万花筒般的仙境。迷失其中还是找到最终答案？等你来挑战！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>游戏特色：<br/>• 创新流畅的一指玩法，通过手指拖拽控制主角前进，搜集星星获得前进的能量，能量不足则会往后退而游戏失败。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>• 创意视觉效果，在2D画面中体验变幻的3D场景。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>• 迷幻优美的画面配合动态多变的光影色彩，人为设计的7大关卡，超过50小关。丰富变幻的场景主题。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>• 美妙音乐和环境音，建议使用耳机。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>• 多个奇幻主角供选择。多种道具和技能供解锁升级，提升你游戏中的表现。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>• 最新技术：支持3Dtouch，重压可释放道具。支持ReplayKit，录制游戏视频与朋友分享。"
                            },
