                            "whatsnew": {
                                "text": "<div>炎炎夏日，一起来和海洋里的小伙伴们狂欢吧~<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>● 夏日活动强势来袭<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>● 新动物鲸鱼登场<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>● 全新动物园装饰登场</div>"
                            },
                            "description": {
                                "text": "在跑酷类游戏没有更大突破口的情况下，巧妙的将养成和跑酷完美进行了结合，创造出了非常有新意的游戏乐趣。<br/>——许慕典《光影对决》制作人<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>《疯狂动物园》对不同动物的操作方式和动物表现都太丰富了。<br/>——邓梁 游戏葡萄主编<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>在跑酷游戏里玩出新花样，谈何容易，《疯狂动物园》做到了。<br/>——拼命玩三郎《锻冶屋英雄谭》制作人<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>HI，牛仔们，刺激的山脉你们都有体验过了吗~有人说收集齐了所有动物~？那么…一大波超新奇稀有动物们已经入驻各个地图！快去找到他们吧！更有全新的帽子和套装等待收集，牛仔变装爬梯全面开启！"
                            },
