                            "whatsnew": {
                                "text": "<div>1：新增双人副本《守卫剑阁》，掉落英雄令姜维和邓艾，掉落红装雁翎圈金甲和孔明灯。<br/>2：新增双人副本《七擒孟获》，掉落英雄令孟获和祝融，掉落红装剑齿虎和猛犸巨象。<br/>3：修改了鲁肃的技能。</div>"
                            },
                            "description": {
                                "text": "三国 + 英雄无敌的完美结合, 全真实的五星玩家评价！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>三国游戏的全新演绎! 有深度!有策略!<br/>可单机可联网的沉浸式三国策略游戏!<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>====传承英雄无敌精髓，自由探索庞大地图====<br/>====单机剧情联网竞技，三国英雄无双技能====<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>鑫线游戏出品：真战棋！真策略！可单机，可竞技的深度战棋RPG《策马三国志》让您绞尽脑汁，废寝忘食！是时候体验真正的英雄无敌手游了!!!<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>＊＊＊＊＊最新动态＊＊＊＊＊<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>五个大章节全面开放：<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>第一篇章 黄 巾 : 从桃园结义到黄巾之乱的等6场战役<br/>第二篇章 乱 世：从勃海守卫战到袁术的毁灭之路等10场战役<br/>第三篇章 官 渡：从白马之围到官渡之战的6场战役以及东吴崛起的4场战役<br/>第四篇章 赤 壁: 从江夏平叛到卧龙出山再到赤壁之战, 华容道等12场三国最高潮的战役<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>神秘的第五篇章《鼎立》已准备就绪～新地图新模式新英雄!满足等待了一年的你！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>另外开放有12张娱乐地图, 9个故事剧情地图包,更多地图和游戏内容持续火热开放中……<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>前三个篇章的战役地图已支持&#34;精英模式&#34;开启, 更多挑战，更多奖励!更多高级橙色装备可以通过积攒密宝碎片来免费获取！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>第四篇章《赤壁》千呼万唤中12张剧情战役已全部放出 : 江夏平叛, 卧龙出山, 火烧博望，长坂坡, 借东风, 火烧赤壁, 等众多历史经典战役以及全新的水上船战得以热血重现！同时徐庶，诸葛亮，黄月英，甘宁, 庞统，孙权等经典三国英雄也同期闪亮登场!<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>大型故事地图包: 《曹操传》上下篇已完整放出, 颠覆式的创新玩法欢迎挑战！ 最新故事包《虎牢关》《山海传说》《战荆州》也已放出！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>PVP竞技场每月一个赛季，月中一个赛点， 火热进行中!<br/>多人合作联机副本，让老司机带着新手飞起来～<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊＊<br/>-----------------------------------------------------------<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>＊＊＊＊＊游戏特色＊＊＊＊＊<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【战役地图自由探索，强力AI也会策略】<br/>剧情地图融合波澜壮阔的三国史上的热血经典战役, 摈弃无脑点击自动寻路模式，您可以控制英雄自由探索地图的每一个角落。地图上的强力AI也会使用策略，将给每位玩家带来不小的挑战。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【六角格回合制战场，瞬息万变步步惊心】<br/>摈弃站桩打斗比拼数值模式，采用手动操控六角格回合制战场的经典玩法。每场战斗都具有不可预测性，哪怕对阵双方阵容完全一致，兵种走位、法术施放、出手时机也会使得战斗的结果天差地别。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【英雄上阵热血搏杀，创新技能进阶升级】<br/>三国名将悉数登场， 结合自身的属性和技能, 也会有&#34;刺客&#34;、&#34;法师&#34;、&#34;坦克&#34;、&#34;辅助&#34;的这样特长分类……游戏拥有数十位可以亲自上阵厮杀的英雄，每位英雄在战场上都有自己的独特定位和独有技能，一次时机合适的技能施放足以改变整场战斗的结果。英雄的技能都可以进阶升级，只要满足了技能进阶所需的属性条件，就可以在原有技能的基础上进一步提升技能效果。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【三大势力五十兵种，战术卡片丰富玩法】<br/>游戏目前开放魏、蜀、吴三大势力，每个势力都拥有自己独有的主城外观及兵种科技。游戏中共有50余种造型、技能各异的兵种，更有可以加强兵种能力甚至改变攻击方式的战术技能卡，搭配出千变万化的玩法。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【多英雄对决竞技场，在线对战比拼智慧】<br/>英雄与兵种的配合是游戏战斗的亮点。在竞技场中，玩家可以同时控制两个英雄、四队小兵上场作战，大大丰富了战术选择。与高手在线对决，根据不同的对手，选择不同的英雄、兵种、战术搭配，每一场战斗都是智慧的比拼。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【副本试炼巨型BOSS，多人合作乐趣无穷】<br/>在副本试炼中玩家可以与他人一起挑战多人副本，选择自己喜欢的英雄组合，配合队友闯关击杀BOSS，不同的副本打法也不一样，需要队友有默契的配合,才能获得最终的胜利。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>另外的重磅消息:<br/>策马三国志的姊妹篇，同属于策马三国系列的硬派塔防游戏《策马守天关》, iOS版已火热推出, 你从没玩过这样的塔防，写实!激烈!策略与操作并重, 除了能够单机体验海量的大型战役关卡，还拥有1对1公平竞技，多人合作无尽模式等全新塔防玩法, AppStore搜索 : &#34;策马守天关&#34;, 欢迎广大玩家前往下载试玩！"
                            },
