                            "whatsnew": {
                                "text": "<div>7月26日版本更新内容如下：<br/>- 开放「黑暗秘宝」活动，持续时间至8月9日24点；<br/>- 限时任务「美食的清凉」截止领取，已领取的招魂师最晚完成时间为2022年8月2日24点；<br/>- 增加玩家信息IP归属地显示。</div>"
                            },
                            "description": {
                                "text": "《地下城堡3: 魂之诗》是一款美式RPG卡牌冒险手游，是经典游戏《地下城堡2:黑暗觉醒》原班人马打造的官方续作。<br/>这一次，你将化身具有唤灵能力的招魂师，召唤自己的英灵伙伴，打造属于自己的最强小队。一起深入被黑暗笼罩的奇幻大陆，开启自己的末世冒险之旅。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>《地下城堡》周年狂欢开启！上线可领88抽和丰富资源福利，更有全新团本和英雄赞歌系统等你体验！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>龙、魔法、地下城——老牌美式RPG冒险<br/>剑、魔法、龙、地下城，传统的冒险，未知的旅途，带你重温奇幻的深坑。躺在床上翻着龙枪、冰风谷，看着黑暗精灵和北地蛮族的传奇，那些难以遗忘的史诗英雄故事。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>神秘日志，开放线索——你才是故事书写者<br/>广阔的阿罗亚大陆，丰富的主线地图，上百迷宫据点，一切只为找寻黑暗的源头。<br/>多线程的副本任务，不止一种完成方式，还原真实冒险体验。邪恶生物，诡谲陷阱，神秘路人，意外情况时常接踵而至。<br/>迷茫的时候别忘了翻阅手中的日志......<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>N大种族，上百英灵——构筑最强英雄卡组<br/>来自人类、龙族、矮人、精灵等十大种族的奇幻生物，分为先锋、异士、支援、护卫四大职业。他们都是带着遗憾牺牲的荒魂，去唤醒他们吧，去组建自己的最强英灵小队，他们将成为你前行的臂助！<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>奇幻迷宫，秘境探险——凭实力一命通关<br/>是梦境还是现实，谁都难辨虚实。看不到尽头的秘境洞穴，每一层都充满未知的随机事件。在黄金灯盏熄灭前，谁能活着离开？<br/>理智前行或许能带你找到光亮，但疯狂的随机选择可能才是正确的方向。这一次，你准备好了吗？<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>战吼走位，buff狂加——输出爆表，极限翻盘<br/>我们的战斗轻量化，易上手。六人远征队，灵活混编。法师队，斧头帮，你的想象力是唯一的极限。<br/>合理搭配阵容，机智调整走位，释放战吼大招，这将帮助你预设万全之策，决胜千里。"
                            },
