                            "whatsnew": {
                                "text": "<div>《魂之刃2》首次不限量删档测试现已结束，新的一年我们会继续努力，加快研发进度，争取早日与各位勇士大人正式的见面。</div>"
                            },
                            "description": {
                                "text": "《代号：魂之刃2》是一款暗黑风格的3D硬核动作ARPG游戏，也是“魂之刃系列”的正统续作。玩家将扮演神话中痛苦、悲伤、平凡，但却伟大的英雄们，在庞大神秘的北欧诸国中冒险，与曾遗失自身“命运”的“献祭者们”进行战斗，并展开自我救赎的旅行。<br/>故事发生在诸神黄昏之前，其时，北欧诸国涌动着不为人知的暗流。全知的神王奥丁，为了攫取英灵而掀起战争；密谋已久的邪神洛基，从深邃的幽暗中悄然现身。命运挑战者卡奥斯，觉醒的女武神伊丝特，被放逐的冥界女神海拉，屠龙勇者齐格飞。各人怀着不同的目标，在此黑暗的时代，拉开了诸神黄昏的序幕。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>【游戏元素】<br/>◆四维世界架构，带时间轴的非线性进程<br/>◆沉浸式交响体验，国际首席爱乐乐团参与音乐录制<br/>◆3个可选角色，12个职业状态，多达百种可习得的技能<br/>◆轻重武器切换、武器变形，多样化战斗系统<br/>◆丰富的怪物困扰，双重考验Build+操作<br/>◆充满未知和随机的地图探索：乱入、玩家冢、伪装怪物、随机传送门...<br/>◆击杀Boss，收集身体部件，作为外观穿戴<br/>◆多人共斗，和伙伴组队挑战Boss<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>《代号：魂之刃2》非游戏最终上线正式名称，请勇士大人们耐心等待，我们即将带正式名与大家见面。<br class=\"bbcode-paragraph-br\"/><br class=\"bbcode-paragraph-br\"/>官方微博：魂之刃2<br/>官方公众号：魂之刃2手游<br/>官方客服：2532783408<br/>"
                            },
